  void filterSearchResults(String query) {
    listOfFilteredServers.clear();
    if (query.isNotEmpty) {
      for (var item in getVpnServerListModel.serverList!) {
        if (item.city!.toLowerCase().contains(query.toLowerCase())) {
          listOfFilteredServers.add(item);
        }
      }
    } else {
      listOfFilteredServers.addAll(getVpnServerListModel.serverList!);
    }
  }

  void clearAll() {
    listOfSelectedServers.clear();
    // listOfSelectedServersIndex.clear();
  }

  FutureWithEither<GetVpn2Model> getVpnList() async {
    showLoader.value = true;

    String url = AppConstants.baseUrlAsKey + EndPoints.vpn2GetEndPoint;

    final response = await apiUtilsWithHeader.get(url: url, firstTime: true);

    return response.fold((l) {
      showLoader.value = false;
      return left(l);
    }, (r) {
      getVpnModel = GetVpn2Model.fromJson(r.data);

      clearAll();
      int index = 0;

      for (var vpn in getVpnModel.vpnList!) {
        listOfSelectedServers.add(getServerCountryCity(vpn.server!, index).obs);
        index++;
      }

      showRefreshTitle.value = false;

      Timer(const Duration(seconds: 10), () {
        showRefreshTitle.value = true;
      });

      showLoader.value = false;

      return right(getVpnModel);
    });
  }

  FutureWithEither<GetVpnServerListModel> getVpnServerList() async {
    showLoader.value = true;

    String url = AppConstants.baseUrlAsKey + EndPoints.vpnServerListGetEndPoint;

    final response = await apiUtilsWithHeader.get(url: url, firstTime: true);

    return response.fold((l) {
      showLoader.value = false;
      return left(l);
    }, (r) {
      GetVpnServerListModel getNewVpnServerListModel =
          GetVpnServerListModel.fromJson(r.data);

      if (getNewVpnServerListModel.serverList!.isNotEmpty) {
        getVpnServerListModel = getNewVpnServerListModel;
        getVpnServerListModel.serverList!
            .sort((a, b) => a.name!.compareTo(b.name!));
        //Change Server List in filter
        filterSearchResults('');

        clearAll();
        int index = 0;
        for (var vpn in getVpnModel.vpnList!) {
          listOfSelectedServers
              .add(getServerCountryCity(vpn.server!, index).obs);
          index++;
        }

        asKeyStorage.saveAsKeyVPNServerListModel(getVpnServerListModel);
      }

      showLoader.value = false;

      return right(getVpnServerListModel);
    });
  }

  ServerItem getServerCountryCity(String server, int index) {
    ServerItem serverItem = ServerItem(
        name: '', country: '', city: '', ip: '', supportProtocol: '');
    if (server.isNotEmpty) {
      for (var i = 0; i < getVpnServerListModel.serverList!.length; i++) {
        if (getVpnServerListModel.serverList![i].name == server) {
          serverItem = getVpnServerListModel.serverList![i];
          listOfSelectedServersIndex[index] = i;

          break;
        }
      }
      // serverItem = getVpnServerListModel.serverList!.firstWhere((element) {
      //   if (element.name == server) {}
      //   return element.name == server;
      // });
    }

    return serverItem;
  }
