  Future<StatusModel?> setVpn(SetVpnParam setVpnParam) async {
    showLoader.value = true;

    final connectivityResult = await (Connectivity().checkConnectivity());
    if (connectivityResult.contains(ConnectivityResult.none)) {
      constants.showSnackbar('Network Error', 'No internet access', 0);
      showLoader.value = false;

      return null;
    }

    Map params = setVpnParam.toJson();

    String url = AppConstants.baseUrlAsKey + EndPoints.vpnSetEndPoint;

    final response = await apiUtilsWithHeader.put(
        url: url, data: jsonEncode(params), firstTime: true);

    return response.fold((l) {
      showLoader.value = false;

      return null;
    }, (r) async {
      StatusModel status = StatusModel.fromJson(r.data);

      showLoader.value = false;

      constants.showSnackbar(
          'VPN Network', 'Successfully saved vpn settings', 1);

      await getVpnList();

      // Get.back();

      return status;
    });
  }

